import React from "react";

class Fish extends React.Component {
  render() {
    const { image, name } = this.props;
    return (
      <li className="menu-fish">
        <img src={image} />
        <h3 className="fish-name">name</h3>
      </li>
    );
  }
}
export default Fish;
